['class Node:

    def __init__(self, x):
        self.val = x
        self.next = None

def funcImp(head: Node) -> bool:
    if not head or not head.next:
        return False
    slow = head
    fast = head.next
    while fast and fast.next:
        if slow == fast:
            return True
        slow = slow.next
        fast = fast.next.next
    return False']

